import axios from 'axios'
import { BASE_COMPOSICION } from '../config';
export default {
  parametros() {
    let url = `${BASE_COMPOSICION}/parametros`;
    return new Promise((resolve, reject) => {
      axios.get(url).then(data => resolve(data.data)).catch(err => reject(err.response))
    })
  },
  guardarComposicion(data) {
    const { idPerfil, composicion } = data;
    let body = Object.assign(composicion, { perfil: idPerfil });

    let url = BASE_COMPOSICION;
    return new Promise((resolve, reject) => {
      axios.post(url, body).then(data => resolve(data.data)).catch(err => reject(err.response))
    })
  },
  listarComposiciones(idPerfil) {
    let url = `${BASE_COMPOSICION}/consumer/${idPerfil}`;
    return new Promise((resolve, reject) => {
      axios.get(url).then(data => resolve(data.data)).catch(err => reject(err.response))
    })
  }
  ,
  solicitarCredenciales(data) {
    const { idPerfil, idComposicion } = data;
    let url = `${BASE_COMPOSICION}/consumer/${idPerfil}`;
    return new Promise((resolve, reject) => {
      axios.post(url, { idComposicion }).then(data => resolve(data.data)).catch(err => reject(err.response))
    })
  }
}
